const InfoMembership = [
  {
    id: 1,
    type: "Daily",
    description: "One day for using all the gym structure",
    period: "24 Hours",
    price: 15000,
  },
  {
    id: 2,
    type: "Biweekly",
    description: "Using the gym structure for 15 days",
    period: "15  Days",
    price: 75000,
  },
  {
    id: 3,
    type: "Month",
    description: "Using the gym structure for the whole month",
    period: "30  Days",
    price: 150000,
  },
];

export default InfoMembership;
